import React from 'react';

const CollapsePanel = (props) => {
   const {title, unique_id} =  props  
    return (
        <div class="accordion md-accordion" id={`${unique_id}`} role="tablist" aria-multiselectable="true">
            {/* <!-- Accordion card --> */}
            <div class="card">

                {/* <!-- Card header --> */}
                <div class="card-header" role="tab" id={`${unique_id}`}>
                    <a data-toggle="collapse" data-parent={`#${unique_id}`} href={`#${unique_id}`} aria-expanded="true"
                        aria-controls={`${unique_id}`}>
                        <h5 class="mb-0">
                             {title} + {"ID : " + unique_id} <i class="fas fa-angle-down rotate-icon"></i>
                        </h5>
                    </a>
                </div>

                {/* <!-- Card body --> */}
                <div id={`${unique_id}`} class="collapse show" role="tabpanel" aria-labelledby={`${unique_id}`} data-parent={`#${unique_id}`}>
                    <div class="card-body">
                        {props.children}
                    </div>
                </div>

            </div>
        </div>
    );
}

export default CollapsePanel;
